"use strict";(self.webpackChunkdoc=self.webpackChunkdoc||[]).push([[8748],{4683:a=>{a.exports=JSON.parse('{"blogPosts":[{"id":"hideable-collapse","metadata":{"permalink":"/doc/blog/hideable-collapse","editUrl":"https://github.com/mhanifmuhsin/doc/blog/2023-08-24-hideable-collapse.md","source":"@site/blog/2023-08-24-hideable-collapse.md","title":"Hideable Sidebar dan Auto Collapse Categories (Doc)","description":"Artikel ini akan membahas konfigurasi untuk Sidebar dan Menu Kategori di Docusaurus, apa yang akan kita lakukan ?, benar kita akan mengaktifkan fitur bawaan dari docusaurus yaitu Hideable Sidebar dan Auto Collapse Categories yang berada pada Menu Doc (atau jika di blog saya berada di Menu Archive, nanti anda akan menemukan sidebar sebagai navigasi ).","date":"2023-08-24T00:00:00.000Z","formattedDate":"August 24, 2023","tags":[{"label":"docusaurus","permalink":"/doc/blog/tags/docusaurus"},{"label":"config","permalink":"/doc/blog/tags/config"}],"readingTime":0.66,"hasTruncateMarker":false,"authors":[{"name":"Muhamad Hanif Muhsin","title":"Front End Developer @ SIESTA","url":"https://github.com/mhanifmuhsin","imageURL":"https://github.com/mhanifmuhsin.png","key":"mhanifmuhsin"}],"frontMatter":{"slug":"hideable-collapse","title":"Hideable Sidebar dan Auto Collapse Categories (Doc)","authors":["mhanifmuhsin"],"tags":["docusaurus","config"]},"nextItem":{"title":"Deploy Docusaurus ke Github Pages","permalink":"/doc/blog/deploy-docu-gh-pages"}},"content":"Artikel ini akan membahas konfigurasi untuk Sidebar dan Menu Kategori di Docusaurus, apa yang akan kita lakukan ?, benar kita akan mengaktifkan fitur bawaan dari docusaurus yaitu **Hideable Sidebar** dan **Auto Collapse Categories** yang berada pada Menu Doc (atau jika di blog saya berada di Menu Archive, nanti anda akan menemukan sidebar sebagai navigasi ).\\n\\nOke langsung saja berikut adalah script yang perlu kita tambahkan di file **docusaurus.config.js** :\\n\\n```javascript\\n\\n themeConfig:\\n    /** @type {import(\'@docusaurus/preset-classic\').ThemeConfig} */\\n    ({\\n      // start\\n      docs: {\\n        sidebar: {\\n          autoCollapseCategories: true,\\n          hideable: true,\\n        },\\n      }\\n    // end\\n    )}\\n```\\n\\nsetelah kita aktifkan maka akan muncul tanda panah dibagian bawah navigasi(sidebar) seperti ini dan jika kita membuka kategori 1 (sampel) dan kemudian kategori 2 (sampel), maka otomatis kategori 1 akan tertutup :\\n\\n![img](./img/sidebar.png)\\n\\nSekian, semoga pemabahasan kali ini bermanfaat \ud83d\ude4f."},{"id":"deploy-docu-gh-pages","metadata":{"permalink":"/doc/blog/deploy-docu-gh-pages","editUrl":"https://github.com/mhanifmuhsin/doc/blog/2023-08-17-deploy-docu-gh-pages.md","source":"@site/blog/2023-08-17-deploy-docu-gh-pages.md","title":"Deploy Docusaurus ke Github Pages","description":"Kali ini kita akan mencoba melakukan deploy Docusaurus ke github pages menggunakan SSH.","date":"2023-08-17T00:00:00.000Z","formattedDate":"August 17, 2023","tags":[{"label":"docusaurus","permalink":"/doc/blog/tags/docusaurus"},{"label":"github","permalink":"/doc/blog/tags/github"},{"label":"github pages","permalink":"/doc/blog/tags/github-pages"}],"readingTime":1.08,"hasTruncateMarker":false,"authors":[{"name":"Muhamad Hanif Muhsin","title":"Front End Developer @ SIESTA","url":"https://github.com/mhanifmuhsin","imageURL":"https://github.com/mhanifmuhsin.png","key":"mhanifmuhsin"}],"frontMatter":{"slug":"deploy-docu-gh-pages","title":"Deploy Docusaurus ke Github Pages","authors":["mhanifmuhsin"],"tags":["docusaurus","github","github pages"]},"prevItem":{"title":"Hideable Sidebar dan Auto Collapse Categories (Doc)","permalink":"/doc/blog/hideable-collapse"},"nextItem":{"title":"Mengenal Docusaurus","permalink":"/doc/blog/docusaurus-2"}},"content":"Kali ini kita akan mencoba melakukan deploy **Docusaurus** ke github pages menggunakan SSH.\\n\\nSebelum melakukan deploy ada beberapa yang harus kita siapkan atau configurasi diantaranya :\\n\\n1.  Siapkan branch dengan nama gh-pages\\n2.  Update konfigurasi di file **docusaurus.config.js**, update dilakukan di atribut : url, baseUrl, organizationName, projectName, deploymentBranch\\n\\n    ```javascript\\n    // Set the production url of your site here\\n    url: \\"https://mhanifmuhsin.github.io\\",\\n    // Set the /<baseUrl>/ pathname under which your site is served\\n    // For GitHub pages deployment, it is often \'/<projectName>/\'\\n    baseUrl: \\"/doc/\\",\\n    // GitHub pages deployment config.\\n    // If you aren\'t using GitHub pages, you don\'t need these.\\n    organizationName: \\"mhanifmuhsin\\", // Usually your GitHub org/user name.\\n    projectName: \\"doc\\", // Usually your repo name.\\n    deploymentBranch: \\"gh-pages\\",\\n\\n    //attibute url, baseUrl, organizationName, dan projectName (Sesuaikan dengan repository masing-masing), untuk deploymentBranch isi dengan gh-pages karena branch ini yang nanti akan kita set sebagai github pages\\n    ```\\n\\n3.  Masuk ke repository, kemudian klik Setting\\n\\n    ![Klik setting](./img/klik-setting.png)\\n\\n4.  Klik menu Pages\\n\\n    ![Klik pages](./img/klik-menu-pages.png)\\n\\n5.  Setup seperti ini\\n\\n    ![Setup](./img/akhir-deploy.png)\\n\\n6.  Kembali ke **Visual Studio Code**\\n\\n7.  Buka terminal dan eksekusi script berikut (masih di branch main/master), dan pastikan bahwa anda mengakses repository sudah menggunakan SSH\\n\\n    ```bash\\n    USE_SSH=true npm run deploy\\n    ```\\n\\n8.  Jika berhasil di terminal akan muncul tapilan seperti berikut :\\n\\n    ![Deploy](./img/success-deploy.png)\\n\\nSekian penjelasan tenang deploy docusaurus ke github pages, semoga bermanfaat."},{"id":"docusaurus-2","metadata":{"permalink":"/doc/blog/docusaurus-2","editUrl":"https://github.com/mhanifmuhsin/doc/blog/2023-08-16-docusaurus-2.md","source":"@site/blog/2023-08-16-docusaurus-2.md","title":"Mengenal Docusaurus","description":"Dalam membuat sebuah dokumentasi pemograman, tentu banyak cara dalam menuangkannya dan banyak juga aplikasi yang menawarkan kemudahan, salah satunya adalah Docusaurus, web ini saya buat mengguanakan docusaurus, keren kan ? , alasan kenapa saya menggunakan docusaurus antara lain :","date":"2023-08-16T00:00:00.000Z","formattedDate":"August 16, 2023","tags":[{"label":"docusaurus","permalink":"/doc/blog/tags/docusaurus"},{"label":"dokumentasi","permalink":"/doc/blog/tags/dokumentasi"}],"readingTime":0.815,"hasTruncateMarker":false,"authors":[{"name":"Muhamad Hanif Muhsin","title":"Front End Developer @ SIESTA","url":"https://github.com/mhanifmuhsin","imageURL":"https://github.com/mhanifmuhsin.png","key":"mhanifmuhsin"}],"frontMatter":{"slug":"docusaurus-2","title":"Mengenal Docusaurus","authors":["mhanifmuhsin"],"tags":["docusaurus","dokumentasi"]},"prevItem":{"title":"Deploy Docusaurus ke Github Pages","permalink":"/doc/blog/deploy-docu-gh-pages"},"nextItem":{"title":"Welcome","permalink":"/doc/blog/welcome"}},"content":"Dalam membuat sebuah dokumentasi pemograman, tentu banyak cara dalam menuangkannya dan banyak juga aplikasi yang menawarkan kemudahan, salah satunya adalah **Docusaurus**, web ini saya buat mengguanakan docusaurus, keren kan ? , alasan kenapa saya menggunakan docusaurus antara lain :\\n\\n1. Instalasi mudah\\n2. Tidak perlu pusing dalam mendesain tampilan, karena sudah disediakan template yang menurut saya cukup untuk menuliskan dokumentasi, sehingga kita hanya fokus dalam konten saja\\n3. Bisa digunakan juga sebagai blog\\n4. Bisa deploy ke github pages\\n5. Menggunakan markdown dalam pembuatan sebuah dokumentasi\\n6. Terdapat beberapa fitur yang luar biasa seperti versioning, i18n, search and theme customizations\\n\\nDocusaurus sudah banyak digunakan oleh perusahaan - perusahaan besar juga antara lain dokumentasi [React Native](https://reactnative.dev/), dokumentasi [Redux](https://redux.js.org/), sehingga tidak salah kita untuk mencoba membuat dokumentasi menggunakan docusaurus ini, sebagai contoh siapa saja yang sudah menggunakan docusaurus kita bisa melihatnya [disiini - (klik disini)](https://docusaurus.io/showcase) yang disediakan oleh docusaurus.\\n\\nSekian untuk pengenalan mengenai Docusaurus, untuk lebih detailnya silahkan langsung kunjungi websitenya dengan [meng klik ini](https://docusaurus.io/)."},{"id":"welcome","metadata":{"permalink":"/doc/blog/welcome","editUrl":"https://github.com/mhanifmuhsin/doc/blog/2023-08-13-welcome/index.md","source":"@site/blog/2023-08-13-welcome/index.md","title":"Welcome","description":"Selamat datang \ud83c\udf89, ini merupakan halaman blog yang menjadi penyemangat saya dalam menggapai cita-cita menjadi seorang programmer yang baik dan berguna bagi bangsa, agama, dan negara.","date":"2023-08-13T00:00:00.000Z","formattedDate":"August 13, 2023","tags":[{"label":"about","permalink":"/doc/blog/tags/about"}],"readingTime":0.835,"hasTruncateMarker":false,"authors":[{"name":"Muhamad Hanif Muhsin","title":"Front End Developer @ SIESTA","url":"https://github.com/mhanifmuhsin","imageURL":"https://github.com/mhanifmuhsin.png","key":"mhanifmuhsin"}],"frontMatter":{"slug":"welcome","title":"Welcome","authors":["mhanifmuhsin"],"tags":["about"]},"prevItem":{"title":"Mengenal Docusaurus","permalink":"/doc/blog/docusaurus-2"}},"content":"Selamat datang \ud83c\udf89, ini merupakan halaman blog yang menjadi penyemangat saya dalam menggapai cita-cita menjadi seorang programmer yang baik dan berguna bagi bangsa, agama, dan negara.\\n\\nPertama, terimakasih saya ucapkan kepada **Alloh SWT**, yang telah memberikan kesempatan saya dalam hidup ini menjadi seorang programmer, Sholawat serta salam kepada **Nabi Muhammad SAW beserta aulia alloh diseluruh penjuru dunia**.\\n\\nKedua, terimakasih saya ucapkan kepada **Orang tua, Istri dan Anak-anak** yang senang tiasa selalu bersama dalam suka maupun duka, semoga kita selalu dalam lindungan **Nya** \ud83e\udd32 aamiin.\\n\\nKetiga, saya ucapkan kepada **teman-teman** yang selalu ada untuk membantu dalam pekerjaan, selalu memotivasi dan memberikan saran serta keritik untuk menjadikan saya lebih baik.\\n\\nPembukaannya saya kira sudah cukup \u2764\ufe0f, blog ini akan saya update ketika saya ada waktu luang **(mudah-mudahan selalu meluangkan waktu)**, pembahasannya tidak lain mengenai hal-hal yang saya pelajari di dunia pemograman, teman-teman boleh share semua konten yang ada disini karena website ini saya dedikasikan untuk semua orang yang ingin belajar.\\n\\nSekian, segera eksekusi \ud83d\ude80 jadilah yang terbaik dari dirimu."}]}')}}]);